import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { getDetail } from "../../Redux/actions";

import Card from '../Card/Card';

const Detail = ({id})=>{


    const dispatch = useDispatch();

    useEffect(()=>{
      dispatch(getDetail())
    },[dispatch])

    return(
     <div>

     </div>
    )
}

export default Detail;
